import React from 'react'
import "./Header.css";
import { searchtoList } from '../Store/shopslice';
import { useDispatch } from 'react-redux';
function Header() {
  const dispatch=useDispatch();
  const searchFilter=(event)=>{
    console.log(event.target.value);
    dispatch(searchtoList(event.target.value));
  }
  return (
    <div className="header">
        <h1 className='header-title'>Shop List</h1>
        <input type="text" placeholder='search shop here' className='searchInput' onChange={searchFilter}></input>
    </div>
  )
}

export default Header
